  return (
    <Container>
      <Row>
        <Col>
        < Navbar/>
        </Col>
      </Row>
      <Row>
        <Col>
          <TopSellers />
        </Col>
      </Row>
      <Row>
        <Col>
          <h2>Popular Categories</h2>
          {/* Add your popular categories here */}
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
